    function(layer){
    let div = L.DomUtil.create('div');
    
    let handleObject = feature=>typeof(feature)=='object' ? JSON.stringify(feature) : feature;
    let fields = ["osmid", "highway", "oneway", "reversed", "length", "grade", "grade_abs", "stoplights", "steps", "surface", "speed_kph", "travel_time", "maxspeed", "name", "width", "access", "lanes", "tunnel", "bridge"];

    let table = '<table>' +
        String(
        fields.map(
        (v,i)=>
        `<tr>
            <th>${aliases[i]}</th>
            
            <td>${handleObject(layer.feature.properties[v])}</td>
        </tr>`).join(''))
    +'</table>';
    div.innerHTML=table;
    
    return div
    }
